import React, { MutableRefObject } from "react";

interface RaiseComponentProps {
  connection: MutableRefObject<WebSocket | null>;
}

const RaiseComponent: React.FC<RaiseComponentProps> = ({ connection }) => {
  return (
    <div>
      <p>This is the raise component.</p>
      {/* Example usage of connection */}
      <button
        onClick={() => {
          connection.current?.send("Raise action");
        }}
      >
        Send Raise Action
      </button>
    </div>
  );
};

export default RaiseComponent;
